    useEffect(() => {
       callApi(location.state.platform, location.state.username)
    }, [location])

    const callApi = async (platform, user) => {
        console.log(platform);
        console.log(user)
        axios.get(`http://localhost:3001/warzone/profile/${platform}/${user}/overview`).then(function(response) {
         console.log(response.data);
      }).catch(function(error) {
         console.log(error.response.data);
      });
    }

